import axios from './axiosUrl';

class AuthServices {
    login(data) { 
        return axios.post('/login/${userName}',data)
    }
    otp(data){  
        return axios.post("/signup/otp",data)
      }
      otpResend(data){ 
        return axios.post('/signup/otp-resend',data)
    }
}

export default new AuthServices();
